measurements.description:
One flower and two buds on one 21.5-cm inflorescence;
dorsal sepal concave, reniform, chartreuse, veins darker chartreuse, white picotee;
synsepal chartreuse, veins darker;
petals obovate, margins ruffled proximal three-fourths, ciliate, yellow, light burgundy stippling basally;
pouch yellow; 
staminode yellow, green centrally;
substance medium; texture waxy.
